INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'contact@socialdata.ai')), 'SocialData Agent', 'AI assistant for social media analytics, influencer metrics, and engagement data', 'gemini-1.5-flash', '{"vendor_policy": "Social media data collected via official APIs and public data. Compliant with platform terms of service and data protection regulations.", "usage_guidelines": "Ideal for brands, agencies, and influencer marketing platforms measuring campaign effectiveness and audience sentiment.", "platforms": "Coverage includes Instagram, TikTok, YouTube, Twitter/X, and Facebook across 100M+ influencers and creators.", "analytics": "Provides engagement rates, audience demographics, brand affinity scores, and influencer authenticity metrics."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'data@sportstats.pro')), 'SportStats Assistant', 'AI assistant for professional sports statistics, game results, and player performance data', 'gemini-1.5-flash', '{"vendor_policy": "Official statistics from NFL, NBA, MLB, NHL, MLS, and major international leagues. Licensed directly from leagues and governing bodies.", "usage_guidelines": "Perfect for sports media, fantasy sports platforms, and sports betting operators requiring authoritative play-by-play data.", "data_depth": "Includes advanced metrics like player tracking data, expected goals (xG), win probability, and player impact estimates.", "licensing": "Commercial use requires league-approved licensing. Non-commercial/personal use allowed under standard subscription."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'sales@oddsdata.io')), 'OddsData Agent', 'AI assistant for sports betting odds, line movements, and wagering market analytics', 'gemini-1.5-flash', '{"vendor_policy": "Odds data from 200+ sportsbooks worldwide updated in real-time. Historical line movement data for modeling market efficiency.", "usage_guidelines": "Essential for sports bettors, sportsbook operators, and quant traders developing betting strategies and risk management systems.", "data_features": "Includes opening lines, closing lines, line steam alerts, sharp money indicators, and implied probability calculations.", "compliance": "Users must comply with local gambling regulations. Data provided for analytical purposes only."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'info@athletemetrics.com')), 'AthleteMetrics Advisor', 'AI assistant for athlete performance data, biometrics, and training analytics', 'gemini-1.5-flash', '{"vendor_policy": "Wearable and performance data from professional athletes (with consent) and sports science research. Fully anonymized for privacy.", "usage_guidelines": "Designed for sports teams, performance coaches, and sports medicine professionals optimizing training and injury prevention.", "metrics": "GPS tracking, heart rate variability, training load, sleep quality, nutrition, and recovery metrics with ML-based injury risk models.", "research": "Aggregate data available for sports science research. Individual athlete data restricted to team use only."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'contact@leagueinsights.net')), 'LeagueInsights Bot', 'AI assistant for sports business data, franchise valuations, and league economics', 'gemini-1.5-flash', '{"vendor_policy": "Business intelligence from league filings, media reports, and proprietary valuations. Covers franchise values, TV deals, and sponsorship rates.", "usage_guidelines": "Ideal for sports investment firms, leagues, and teams analyzing franchise valuations, media rights, and business strategy.", "data_sources": "Financial data from Forbes, public filings, media rights deals, attendance records, and luxury tax/salary cap information.", "insights": "Includes revenue projections, competitive balance metrics, and market opportunity assessments for expansion and relocation decisions."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'data@retailpulse.com')), 'RetailPulse Assistant', 'AI assistant for point-of-sale data, retail transactions, and store performance analytics', 'gemini-1.5-flash', '{"vendor_policy": "POS data from 50,000+ retail locations across grocery, apparel, electronics, and general merchandise. All customer data anonymized.", "usage_guidelines": "Essential for retailers, CPG brands, and market research firms analyzing sales trends, market share, and promotional effectiveness.", "data_granularity": "Transaction-level data with product UPC, price, quantity, store location, and timestamp. Weekly aggregations available for trend analysis.", "insights": "Includes basket analysis, price elasticity, competitive set performance, and same-store sales growth metrics."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'sales@ecomanalytics.io')), 'EcomAnalytics Agent', 'AI assistant for e-commerce data, online shopping behavior, and conversion analytics', 'gemini-1.5-flash', '{"vendor_policy": "E-commerce data from 10,000+ online retailers and marketplaces. Session-level clickstream data with full customer journey tracking.", "usage_guidelines": "Perfect for e-commerce platforms, digital agencies, and brands optimizing conversion funnels, cart abandonment, and personalization.", "data_coverage": "Includes product views, add-to-cart events, checkout steps, payment methods, device types, and referral sources.", "analytics": "Provides conversion rate benchmarks, cart abandonment analysis, customer lifetime value predictions, and A/B test results."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'info@loyaltymetrics.net')), 'LoyaltyMetrics Advisor', 'AI assistant for customer loyalty programs, rewards data, and retention analytics', 'gemini-1.5-flash', '{"vendor_policy": "Loyalty program data from 500+ brands across retail, hospitality, and services. Member behavior tracking from enrollment through redemption.", "usage_guidelines": "Designed for loyalty program managers, CRM teams, and customer analytics professionals measuring engagement and ROI.", "metrics": "Points earned/redeemed, tier progression, member engagement scores, program economics, and churn risk predictions.", "best_practices": "We provide benchmarking against industry standards and recommendations for reward structure optimization."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'contact@inventoryintel.com')), 'InventoryIntel Assistant', 'AI assistant for inventory management, supply chain data, and stock optimization analytics', 'gemini-1.5-flash', '{"vendor_policy": "Real-time inventory data from warehouses, distribution centers, and retail stores. Includes stock levels, replenishment orders, and supplier performance.", "usage_guidelines": "Essential for supply chain managers, procurement teams, and logistics professionals optimizing inventory turns and reducing stockouts.", "data_coverage": "SKU-level inventory positions, demand forecasts, lead times, fill rates, and warehouse capacity utilization.", "forecasting": "ML-powered demand forecasting models considering seasonality, promotions, and market trends with 85%+ accuracy."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'data@cloudmetrics.io')), 'CloudMetrics Agent', 'AI assistant for cloud infrastructure data, resource utilization, and cost analytics', 'gemini-1.5-flash', '{"vendor_policy": "Multi-cloud monitoring data from AWS, Azure, GCP, and Oracle Cloud. Real-time metrics with 5-minute granularity and historical data retention.", "usage_guidelines": "Ideal for DevOps teams, FinOps practitioners, and cloud architects optimizing resource utilization and controlling cloud costs.", "integrations": "Native integrations with CloudWatch, Azure Monitor, Google Cloud Operations, and custom metrics via StatsD/Prometheus.", "cost_optimization": "Automated rightsizing recommendations, reserved instance analysis, and commitment discount optimization."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'info@devopsdata.com')), 'DevOps Intelligence Bot', 'AI assistant for DevOps metrics, CI/CD pipelines, and software delivery analytics', 'gemini-1.5-flash', '{"vendor_policy": "Deployment and pipeline data from Jenkins, GitHub Actions, GitLab CI, CircleCI, and Azure DevOps. Incident data from PagerDuty, Opsgenie.", "usage_guidelines": "Perfect for engineering leaders, SREs, and platform teams tracking DORA metrics and improving software delivery performance.", "metrics": "Deployment frequency, lead time for changes, MTTR, change failure rate, and custom KPIs aligned with business objectives.", "benchmarking": "Compare your team''s performance against industry benchmarks (Elite/High/Medium/Low performers) and track improvement over time."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'sales@apianalytics.net')), 'API Analytics Assistant', 'AI assistant for API usage data, endpoint performance, and integration analytics', 'gemini-1.5-flash', '{"vendor_policy": "Comprehensive API analytics including request logs, response times, error rates, and consumer behavior. Supports REST, GraphQL, and gRPC.", "usage_guidelines": "Essential for API product managers, platform engineers, and developer relations teams optimizing API performance and adoption.", "monitoring": "Real-time alerting on latency spikes, error rate increases, and rate limit breaches. Historical trend analysis for capacity planning.", "developer_insights": "Track API consumer adoption, integration patterns, SDK usage, and developer onboarding friction points."}'::jsonb, TRUE);
INSERT INTO ai_agents (vendor_id, name, description, model_used, config, active) VALUES ((SELECT id FROM vendors WHERE user_id = (SELECT id FROM users WHERE email = 'contact@usageinsights.com')), 'SaaS Usage Bot', 'AI assistant for SaaS product analytics, feature adoption, and user engagement data', 'gemini-1.5-flash', '{"vendor_policy": "Product telemetry from SaaS applications tracking user behavior, feature usage, and engagement patterns. Privacy-first with anonymization.", "usage_guidelines": "Designed for product managers, growth teams, and customer success professionals optimizing product-market fit and reducing churn.", "analytics": "User activity logs, feature adoption funnels, cohort retention, NPS correlation with usage, and predictive churn models.", "integrations": "Works with Segment, Mixpanel, Amplitude, and custom event tracking. Supports product-led growth and expansion revenue strategies."}'::jsonb, TRUE);
